script: |
  super -f text -I q10942.spq | sort > q10942.out

inputs:
  - name: q10942.spq
    data: |
      SELECT ALL + col2 - 26 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 + - ( + col0 ) * + + 95 * - col2 / + 82 NOT BETWEEN ( - col1 - col2 ) AND + col2;
  - name: tab1

outputs:
  - name: q10942.out
    data: |
      33
      42
      70
